import './App.css';

function App() {
  return (
    <>
      <div class="inputCityDiv">
			<form action="#">
				<label for="city-input">How is the sky in: </label>
				<input type="text" id="city-input" />
			</form>
		</div>
    </>
  );
}

export default App;
